
                <!DOCTYPE html>
                <html lang="es">
                <head>
                    <meta charset="UTF-8">
                    <meta name="viewport" content="width=device-width, initial-scale=1.0">
                    <title>Catálogo de Productos</title>
                    <style>
                        * {
                            margin: 0;
                            padding: 0;
                            box-sizing: border-box;
                            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
                        }
                        
                        body {
                            background: #f5f7fa;
                            color: #333;
                            line-height: 1.6;
                            padding: 30px;
                        }
                        
                        .header {
                            text-align: center;
                            margin-bottom: 40px;
                            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
                            color: white;
                            padding: 30px;
                            border-radius: 15px;
                            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
                        }
                        
                        h1 {
                            font-size: 2.5rem;
                            margin-bottom: 10px;
                        }
                        
                        .catalog-grid {
                            display: grid;
                            grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
                            gap: 30px;
                            max-width: 1200px;
                            margin: 0 auto;
                        }
                        
                        .product-card {
                            background: white;
                            border-radius: 15px;
                            overflow: hidden;
                            box-shadow: 0 10px 25px rgba(0, 0, 0, 0.08);
                            transition: transform 0.3s, box-shadow 0.3s;
                        }
                        
                        .product-card:hover {
                            transform: translateY(-5px);
                            box-shadow: 0 15px 30px rgba(0, 0, 0, 0.15);
                        }
                        
                        .product-image {
                            width: 100%;
                            height: 250px;
                            object-fit: cover;
                            border-bottom: 1px solid #eee;
                        }
                        
                        .product-info {
                            padding: 25px;
                        }
                        
                        .product-name {
                            font-weight: bold;
                            font-size: 1.4rem;
                            margin-bottom: 15px;
                            color: #333;
                        }
                        
                        .product-prices {
                            margin-bottom: 10px;
                        }
                        
                        .wholesale-price {
                            color: #e74c3c;
                            font-weight: bold;
                            font-size: 1.1rem;
                        }
                        
                        .sale-price {
                            color: #2ecc71;
                            font-weight: bold;
                            font-size: 1.1rem;
                        }
                        
                        .product-code {
                            color: #7f8c8d;
                            font-size: 0.95rem;
                            margin-top: 15px;
                        }
                        
                        .product-date {
                            color: #95a5a6;
                            font-size: 0.85rem;
                            margin-top: 10px;
                        }
                        
                        .footer {
                            text-align: center;
                            margin-top: 50px;
                            color: #7f8c8d;
                            font-size: 0.9rem;
                        }
                        
                        @media print {
                            body {
                                padding: 0;
                            }
                            
                            .product-card {
                                break-inside: avoid;
                                margin-bottom: 20px;
                            }
                        }
                    </style>
                </head>
